import React, { useState } from 'react';
import { ReactComponent as Logo } from '../../assets/logo.svg';
import { HashLink } from '@components/links';
import { Box } from '@components/wrappers';
import styled from 'styled-components';

interface MobNavProps {
	isOpen: boolean;
}

const NavbarController = styled.div<MobNavProps>`
	width: 100%;
	padding: 15px 20px;
	position: fixed;
	display: flex;
	top: 0;
	left: 0;
	justify-content: space-between;
	align-items: center;
	background: rgba(0, 0, 0, 0.3);
	backdrop-filter: blur(15px);
	& > a > svg {
		width: 140px;
	}
	& > div {
		height: 20px;
		display: flex;
		justify-content: space-between;
		flex-direction: column;
		div {
			width: 30px;
			height: 0.3em;
			background-color: var(--subtext);
			border-radius: 20px;
			transition: all 0.5s;
		}
		div:first-of-type {
			transform: ${({ isOpen }) => isOpen && 'rotate(45deg) translate(6px, 6px)'};
		}
		div:nth-of-type(2) {
			display: ${({ isOpen }) => isOpen && 'none'};
		}
		div:last-of-type {
			transform: ${({ isOpen }) => isOpen && 'rotate(135deg) translate(0px, 5px)'};
		}
	}
`;

const MobNavbar: React.FC = () => {
	const [isOpen, setIsOpen] = useState(true);
	return (
		<>
			<NavbarController isOpen={isOpen}>
				<HashLink to='/'>
					<Logo />
				</HashLink>
				<Box>
					<div />
					<div />
					<div />
				</Box>
			</NavbarController>
		</>
	);
};

export default MobNavbar;
